observacoes:
As partes acordam que as entregas serão realizadas em duas etapas, conforme segue:

I. Primeira Etapa: entrega de 01 (um) creator e 08 (oito) vídeos para anúncio;
II. Segunda Etapa: entrega de 01 (um) creator e 08 (oito) vídeos para anúncio.

As PARTES acordam que o escopo de trabalho prestado pela CONTRATADA para o serviço de Desenvolvimento de Ecommerce será:
- Personalização Passível de alterações básicas com sessões previamente desenvolvidas;

- Páginas Home, Serviço/Produto, Coleção, Carrinho, Checkout, Contato, Quem Somos, Políticas (Privacidade, reembolso, frete, termos de serviço);

- Processo Revisão de layout (2 review), Revisão de desenvolvimento (1 review interno), Revisão pós-desenvolvimento (1 review);

- Funcionalidades Integrações padrões: Getaway de pagamento, logística e gerenciador de estoque (ERP), Personalização básica de e-mails de comunicação, Criação dos fluxos básicos de recuperação de carrinho abandonado e pagamento;
